// @ts-nocheck
import { type Script } from "@blaze-cardano/core";
import { applyParamsToScript, cborToScript } from "@blaze-cardano/uplc";
import { type PlutusData } from "@blaze-cardano/core";

export interface FinaleManagerSpend {
  new (
    policyId: string,
    admin: { VerificationKey: [string] } | { Script: [string] },
  ): Script;
  datum: {
    finishedGames: bigint;
    kills: Array<bigint>;
    pkhs: Array<string>;
    nftNames: Array<string>;
  };
  redeemer: "StoreGame" | "Distribute";
}

export const FinaleManagerSpend = Object.assign(
  function (
    policyId: string,
    admin: { VerificationKey: [string] } | { Script: [string] },
  ) {
    return cborToScript(
      applyParamsToScript(
        "",
        [policyId, admin],
        {
          dataType: "list",
          items: [
            { title: "PolicyId", dataType: "bytes" },
            {
              title: "PaymentCredential",
              description:
                "A general structure for representing an on-chain `Credential`.\n\n Credentials are always one of two kinds: a direct public/private key\n pair, or a script (native or Plutus).",
              anyOf: [
                {
                  title: "VerificationKey",
                  dataType: "constructor",
                  index: 0,
                  fields: [{ dataType: "bytes" }],
                },
                {
                  title: "Script",
                  dataType: "constructor",
                  index: 1,
                  fields: [{ dataType: "bytes" }],
                },
              ],
            },
          ],
        } as any,
      ),
      "PlutusV3",
    );
  },
  {
    datum: {
      title: "Series",
      anyOf: [
        {
          title: "Series",
          dataType: "constructor",
          index: 0,
          fields: [
            { dataType: "integer", title: "finishedGames" },
            {
              dataType: "list",
              items: { dataType: "integer" },
              title: "kills",
            },
            {
              dataType: "list",
              items: { title: "VerificationKeyHash", dataType: "bytes" },
              title: "pkhs",
            },
            {
              dataType: "list",
              items: { title: "AssetName", dataType: "bytes" },
              title: "nftNames",
            },
          ],
        },
      ],
    },
  },
  {
    redeemer: {
      title: "Redeemer",
      anyOf: [
        { title: "StoreGame", dataType: "constructor", index: 0, fields: [] },
        { title: "Distribute", dataType: "constructor", index: 1, fields: [] },
      ],
    },
  },
) as unknown as FinaleManagerSpend;

export interface FinaleManagerElse {
  new (
    policyId: string,
    admin: { VerificationKey: [string] } | { Script: [string] },
  ): Script;
  null: PlutusData;
}

export const FinaleManagerElse = Object.assign(
  function (
    policyId: string,
    admin: { VerificationKey: [string] } | { Script: [string] },
  ) {
    return cborToScript(
      applyParamsToScript(
        "",
        [policyId, admin],
        {
          dataType: "list",
          items: [
            { title: "PolicyId", dataType: "bytes" },
            {
              title: "PaymentCredential",
              description:
                "A general structure for representing an on-chain `Credential`.\n\n Credentials are always one of two kinds: a direct public/private key\n pair, or a script (native or Plutus).",
              anyOf: [
                {
                  title: "VerificationKey",
                  dataType: "constructor",
                  index: 0,
                  fields: [{ dataType: "bytes" }],
                },
                {
                  title: "Script",
                  dataType: "constructor",
                  index: 1,
                  fields: [{ dataType: "bytes" }],
                },
              ],
            },
          ],
        } as any,
      ),
      "PlutusV3",
    );
  },

  { null: {} },
) as unknown as FinaleManagerElse;
